import styled from 'styled-component';

const LayoutDiv = styled.div`
  display: grid;
  grid-template-rows: 250px 1fr 200px;
  grid-template-columns: 1fr;
  place-items: center center;
`;

const Layout = () => {
  return <LayoutDiv></LayoutDiv>;
};

export default Layout;
